"use strict";
// Objects
/*
    Objects are data types that store key-value pairs.
*/
// We can define the type in the same line
let student = {
    name: "Rishi",
    address: "Kolkata",
    phone: 754807,
    isActive: true,
};
console.log(student);
console.log(student.name);
console.log(typeof (student));
